import './style.css';
import Card from '../../Componentes/Card';

function Sobre() {
    return(
    <section>
        <aside>
            <div className='background-box-2'></div>

            <img className='img-eu' src='./Assets/img/eu-github.jpg'></img>
        </aside>
        <div>
            <div className='background-box-1'></div>
        </div>
  
        <Card title={'Olá, eu sou o João Guilherme'} content={`Desenvolvedor responsável, trabalho com solucões Voltada para Web. Mineiro. Sempre buscando evolução.Confira os meus projetos:  `}></Card>
    </section>)
}

export default Sobre;
